/** Устанавливает маски для элементов */
function SetMaskToField() {
    let my_input_form = [].slice.call(document.querySelectorAll('.input_field'));
    my_input_form.forEach(function (item, i, arr) {
        let input_field = jQuery('#' + item.id);
        if (input_field.attr('mask')) {
            var mask = input_field.attr('mask');
            let autoclear = true;
            if (typeof replaceAll == 'function') {
                mask = mask.replaceAll(/[9]/g, 'd');
            } else {
                mask = mask.replace(/[9]/g, 'd');
            }
            if (
                typeof input_field.attr('data-autoclear-mask') !== 'undefined'
                && input_field.attr('data-autoclear-mask') === 'true'
            ) {
                autoclear = false;
            }
            switch (mask) {
                case 'num':
                    // input_field.maskMoney({thousands: '', allowZero: true});
                    input_field.addClass('num');
                    break;

                default:
                    input_field.mask(mask, {autoclear: autoclear}).on('click', function () {
                        if (jQuery(this).val() === '+7(___)___-____') {
                            jQuery(this).get(0).setSelectionRange(2, 2);
                        } else if (
                            jQuery(this).val() === '____'
                            || jQuery(this).val() === '______'
                            || jQuery(this).val() === '___-___-___ __'
                            || jQuery(this).val() === '__.__.____'
                        ) {
                            jQuery(this).get(0).setSelectionRange(0, 0);
                        }
                    });
                    break;
            }
        }
    });
}
