function accordion(e) {
    if (e.target.open) {
        var t = e.target.parentNode.children;
        for (i = 0; i < t.length; i++) "DETAILS" == t[i].tagName && t[i].hasAttribute("open") && e.target != t[i] && t[i].removeAttribute("open")
    }
}

function check_field_theme(field) {
    let result = true;
    let message = '';

    if (
        jQuery(field).attr('id') === 'place_of_birth'
    ) {
        if (jQuery(field).val().length <= 2) {
            result = false;
            message = 'Слишком короткое значение!';
        }
    }

    return {
        result: result,
        message: message
    };
}

