/**
 * Получение склонение слова "день"
 * type - Тип (1 - день, 2 - месяц, 3 - недель)
 */
function getDeclensionWordDay(day, type = 1) {
    let result;
    let format;
    day = day.toString();

    if (day === '1' || (day.substr(-1) === '1' && day.substr(-2) !== '11')) {
        format = 1;
    } else if (
        jQuery.inArray(day.substr(-1), ['2', '3', '4']) !== -1
        && day.substr(-2) !== '12'
        && day.substr(-2) !== '13'
        && day.substr(-2) !== '14'
    ) {
        format = 2;
    } else {
        format = 3;
    }

    if (+type === 3) {
        if (format === 1) {
            result = 'неделя';
        } else if (format === 2) {
            result = 'недели';
        } else {
            result = 'недель';
        }
    } else if (+type === 2) {
        if (format === 1) {
            result = 'месяц';
        } else if (format === 2) {
            result = 'месяца';
        } else {
            result = 'месяцев';
        }
    } else { // 1
        if (format === 1) {
            result = 'день';
        } else if (format === 2) {
            result = 'дня';
        } else {
            result = 'дней';
        }
    }

    return result;
}

function formatPrice(price) {
    let result = '';
    if (typeof (price) != 'undefined') {
        if (typeof (price) == 'number')
            price = price.toString();
        if (price.length > 0) {
            let testPrice = /^([\d]+)|([\d]+\.|,[\d]+)$/;
            if (testPrice.test(price)) {
                let str, integral, decimal, delim, regex;
                regex = /\.|,[\d]+$/ig;
                delimPos = price.search(regex);
                if (delimPos >= 0) {
                    integral = price.substr(0, delimPos);
                    decimal = price.substr(delimPos + 1);
                } else {
                    integral = price;
                    decimal = '';
                }
                str = integral;
                let blockSize = 3;
                if (str.length > blockSize) {
                    while (str.length > 0) {
                        if (str.length > blockSize) {
                            result = ' ' + str.substr((blockSize * (-1)), blockSize) + result;
                            str = str.substr(0, (str.length - blockSize));
                        } else {
                            result = str + result;
                            str = '';
                        }
                    }
                    result = decimal.length > 0 ? result + '.' + decimal : result;
                } else {
                    result = str + (decimal.length > 0 ? '.' + decimal : '');
                }
            } else {
                result = price;
            }
        }
    }
    return result;
}


